import './App.css';
import Navbar from './components/navbar' ;
import Home  from './pages/home' ; 
import {BrowserRouter as Router ,Route , Routes } from 'react-router-dom'; 
function App() {
  return (
    <div className="App">
      <Router>
        <div> <Navbar/></div>

      <Routes>
        <Route path='/'exact Component={Home}/>
      </Routes>
      </Router>

    </div>
  );
}

export default App;
